import './App.scss';
import Header from "./components/header/Header";
import Home from "./components/home-block/Home";
import Get from "./components/get-block/Get";
import Post from "./components/post-block/Post";

function App() {
  return (
      <div className="wrapper">
        <Header/>
          <Home/>
          <Get/>
          <Post/>
      </div>
  );
}

export default App;
